import React from 'react'
import { ProjectMainSection } from '../../../SectionsComponents'
/* IMAGES */
const MainBG = '/Assets/Images/Bessarabkiy/MainBG.png'

export const Main = () => (
  <ProjectMainSection
    isContentWhite
    id="bessarabskiy"
    background={MainBG}
    name="Бессарабский дворик"
  />
)
